import React, { useState, useEffect } from 'react';
import VolunteerList from './VolunteerList';
import VolunteerForm from './VolunteerForm';
import { createVolunteer } from '../services/api'; // API function
import './styles.css';

const VolunteerPoints = () => {
    const [volunteers, setVolunteers] = useState([]);

    const addVolunteer = (newVolunteer) => {
        setVolunteers([...volunteers, newVolunteer]);
        createVolunteer(newVolunteer)
            .then(response => console.log('Volunteer saved:', response))
            .catch(error => console.error('Error saving volunteer:', error));
    };

    return (
        <div className="volunteer-management">
            <h2>Volunteer Points Management</h2>
            <VolunteerForm addVolunteer={addVolunteer} />
            <VolunteerList volunteers={volunteers} />
        </div>
    );
};

export default VolunteerPoints;
